# })
# })
# .flatten()
# // Extracting M2 14 Rx and Ry rigid body motions
# .map(|x| {
# x.chunks(6)
# .flat_map(|x| x[3..5].to_vec())
# .collect::<Vec<f64>>()
# })
# // Throwing an error if IO::MCM2RB6D is missing
# .ok_or_else(|| DOSIOSError::Inputs("Integrate MCM2RB6D IO input error".into()))?;
