CEO compiles only on a machine with a NVIDIA GPU installed and with the CUDA API present. CEO installation steps are given here . CEO bindings crate crseo, needs to be added to the dependencies list in the Cargo.toml file of your project, both the dosio crate and the dosio feature of crseo are required in order to compile the Dos interface: dosio = { git = "https://github.com/rconan/dosio.git", branch = "main" }
# should be the git url, but with the git repo, CEO does not compile? crseo = { path = "/home/rconan/projects/crseo" , features = ["dosio"]}
#crseo = { git = "https://github.com/rconan/crseo.git", branch = "main", features = ["dosio"] }

